
#-- On-street parking table 
CREATE TABLE onstreetparking (
  id INT UNSIGNED NOT NULL,
  latitude DOUBLE NOT NULL DEFAULT 0.0,
  longitude DOUBLE NOT NULL DEFAULT 0.0, 
  unavailableTime TEXT NOT NULL,
  forcharge char(1) NOT NULL DEFAULT 'N',
  address TEXT NOT NULL,
  PRIMARY KEY  (id)
) DEFAULT CHARACTER SET utf8 COLLATE utf8_general_ci; 

/********************************************************************/
#-- parking lot table 
CREATE TABLE parkinglot (
  id INT UNSIGNED NOT NULL AUTO_INCREMENT,
  lic INT UNSIGNED NOT NULL UNIQUE,
  company varchar(30) NOT NULL DEFAULT "",
  name TEXT NOT NULL,
  paymentoption varchar(30) NOT NULL DEFAULT "",
  rules TEXT NOT NULL,
  type varchar(30) NOT NULL DEFAULT "",
  latitude DOUBLE NOT NULL DEFAULT 0.0,
  longitude DOUBLE NOT NULL DEFAULT 0.0,
  unavailableTime TEXT NOT NULL,
  openTime TEXT NOT NULL,
  forcharge char(1) NOT NULL DEFAULT "Y",
  hasphoto char(1) NOT NULL DEFAULT "1",
  address TEXT NOT NULL,
  PRIMARY KEY  (id)
) DEFAULT CHARACTER SET utf8 COLLATE utf8_general_ci; 


















